// src/App.js

import React from 'react';
import { WorkflowProvider } from './context/WorkflowContext'; // If still needed for other context
import Flow from './Flow';
import Sidebar from './components/Sidebar';
import styled from 'styled-components';
import './styles.css';

const AppContainer = styled.div`
  display: flex;
  height: 100vh;
`;

const MainArea = styled.div`
  flex: 1;
  position: relative;
`;

function App() {
  return (
    <AppContainer>
      <MainArea>
        <Flow />
      </MainArea>
    </AppContainer>
  );
}

export default App;
